import React from "react";
import "./OrderProductDisplay.css";
import image1 from "../User-images/laptop34.webp";

function OrderProductDisplay() {
  return (
    <div className="laptop-order-container">
      <div className="laptop-order-card">
        <div className="laptop-image">
          <img src={image1} alt="Laptop" />
        </div>
        <div className="laptop-details">
          <h5 className="laptop-name">
            <a href="#">
              Lenovo Legion 5 <span className="laptop-brand">HP</span>
            </a>
          </h5>
          <h4 className="laptop-price">
            <span>&#x20B9;</span> 1,500{" "}
            <span className="laptop-payment-method text-muted">via (COD)</span>
          </h4>
          <p className="laptop-quantity">Qt: 1 Pair</p>
        </div>
      </div>
    </div>
  );
}

export default OrderProductDisplay;
